css:
@-moz-document domain("feedly.com") {
@-moz-document domain("feedly.com") {
#feedlyTabsHolder, #feedlyTabs, #feedlyPageHolderFX, #searchBarFX, .floatingEntryScroller, .entryholder, .headerInfo, body, #feedlyFrame, .fx .popover, #addContentPlaceholderFX .menu {
    background-color: #191E29;
    color: #c0c0c0;
}

.fx .entry.unread .title, .fx h1 .heading, .slideEntryContent .u100Entry .title, a, .entryBody, .fx .menu .item {
   color: #c0c0c0; 
}

.fx .entry.read .title {
    color: #636363;
}

.fixed-bar {
    display: none;
}



.actions-container i, .icon-toolbar-refresh-secondary, 
.headerInfo.sliderContainer i, .fx button.tertiary {
	filter: invert(100%);
}

.icon-fx-cards-layout, .icon-fx-more-ios-md-black, i.icon-fx-cards-layout,
.handle.expanded, .icon-fx-arrowhead-down-ios-sm-black,
.fx .tag-button > .button-dropdown > button.dark {
	filter: invert(0);
}

.fx-button.secondary, .fx .button.secondary, .fx button.secondary {
    border-color: #4f4f4f;
}

.floatingEntryContent-tab.tab_0 {
    filter: invert(90%);
}
}
}
